import React from 'react'

class TotalCost extends React.Component {

    render() {
        console.log(this.props.product[0])
        return (
            <div className="totalCost-elements">
                <img style={{ paddingTop: "40px" }} src={require('./images/shop.png')} alt="shopping cart" width="120" height="100" ></img>
                <p>Hello</p>
                <p style={{ margin: "0px", paddingTop: "80px", paddingRight: "200px" }}>
                    {this.props.products[0].price * this.props.products[0].amount + this.props.products[1].price * this.props.products[1].amount + this.props.products[2].price * this.props.products[2].amount}
                    $
                 </p>

            </div>
        )
    }
}

export default TotalCost;
